import { Row, Col } from "react-bootstrap";

const Tabs = (props) => {
  return (
    <Row>
      <Col onClick={props.onClick} className="tab-col">
        <div className="tab active do pobrania">
          <h3>Wnioski do pobrania</h3>
        </div>
      </Col>
      <Col onClick={props.onClick} className="tab-col ">
        <div className="tab interaktywne">
          <h3>Interaktywne formularze</h3>
        </div>
      </Col>
    </Row>
  );
};

export default Tabs;
